import styled from "styled-components";

export const StyledFooter = styled.footer`
  width: ${(props) => props.theme.pageWidth};
  margin: 0 auto;
  display: flex;
  align-items: center;
  font-size: 10px;
  line-height: 12px;
    padding-top: 60px;
    padding-bottom: 60px;
    margin-top: 120px;
`;
